import { Component } from '@angular/core';

@Component({
  selector: 'app-header',
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.css']
})
export class HeaderComponent {
  orgLogoUrl = 'assets/logo.svg';
  userProfileImg = 'assets/profile.svg';
  activeLink: 'home' | 'leaderboard' | 'dashboard' = 'home';
  notifications: string[] = ['Welcome to SkillMuni!', 'You have a new message.'];
  showNotifications = false;

  setActiveLink(link: 'home' | 'leaderboard' | 'dashboard') {
    this.activeLink = link;
  }

  toggleNotifications() {
    this.showNotifications = !this.showNotifications;
  }
}

<nav class="navbar-job shadow-nav">
  <div class="container-fluid">
    <!-- Logo Section -->
    <div class="left-section d-flex align-items-center">
      <img src="assets/icons/skillmuni-logo.png" alt="Skillmuni Logo" class="logo-left" routerLink="/home" />
    </div>

    <!-- Right Section: Notification + Profile -->
    <div class="right-section d-flex align-items-center">
      <div class="icon-wrapper">
        <img src="assets/icons/bell-icon.png" alt="Notifications" class="header-icon bell" />
      </div>
      <div class="icon-wrapper">
        <img src="assets/icons/user-icon.png" alt="User Profile" class="header-icon profile" />
      </div>
    </div>
  </div>
</nav>
